import React, { useEffect } from "react";
import { useNavigate } from "react-router-dom";
import "../Styles/footer.css"

// GovUK imports
import { PhaseBanner, Panel, Button, SectionBreak } from "govuk-react";
import Navigation from "../Components/Navigation";

function HomePage() {
  const navigate = useNavigate();

  let userType = localStorage.getItem("userType");

  useEffect(() => {
    const title = "Log in";
    document.title = title;
  });

  return (
    <div>
      <Navigation
        pageLink1="/"
        PageName1="Home"
        pageLink2="/NhsNumber"
        PageName2="Register"
      />

      <SectionBreak level="XLARGE" visible={false} />

      <Panel title="Welcome to Group E's GovUK GP Surgery">
        <p>
          <Button
            onClick={() => {
              navigate("/login");
            }}
            disabled={userType === 'Patient'}
          >
            Patient
          </Button>
          &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
          <Button
            onClick={() => {
              navigate("/stafflogin");
            }}
            disabled={userType === "Doctor" || userType === "Admin"}
          >
            Staff
          </Button>
        </p>
      </Panel>

      <SectionBreak level="XLARGE" visible={false} />
      <SectionBreak level="XLARGE" visible={false} />
      <SectionBreak level="LARGE" visible={true} />

      <PhaseBanner level="Alpha">
        <p className="banner">
          <strong>Alpha 1.2.1</strong> This is a new service â€“ your{" "}
          <a href="#">feedback</a> will help us to improve it.
        </p>
      </PhaseBanner>
    </div>
  );
}

export default HomePage;
